con:testCase.con:setupScript:
log.info("begin test case start up");

log.info("testScenario=" + context.getProperty("testScenario") );

def testcase="ThreeDocuments";
def assigningAuthority = context.testCase.testSuite.project.getPropertyValue("${testcase}.patientAssigningAuthority");
def patientId = context.testCase.testSuite.project.getPropertyValue("${testcase}.patientId");
context.testCase.setPropertyValue('QualifiedPatientId', "'${patientId}^^^&amp;${assigningAuthority}&amp;ISO'");
context.testCase.setPropertyValue('ExpectedNumberOfDocuments',context.testCase.testSuite.project.getPropertyValue("${testcase}.ExpectedNumberOfDocuments"));
log.info("end test case start up");

